import React from 'react';
import {Card,Header} from 'semantic-ui-react';
const fullpost=(props)=>{
    return(
        <div>
            <Card.Group>
                <Card>
                    <Card.Content>
                        <Card.Header>{props.title}</Card.Header>
                        <Card.Description>{props.content}</Card.Description>
                    </Card.Content>
                </Card>
            </Card.Group>



        </div>
    )
}

export default fullpost;
